import React from 'react';
import Header from './components/Header';
import './App.css';

function App() {
    return (
        <div className="App">
            <Header />
            <main style={{ padding: '2rem', textAlign: 'center' }}>
                <h1>Welcome to Four Ones</h1>
                <p>Pop-up Space Marketplace</p>
                <p>Connect with amazing commercial spaces for your next class, shop, or event.</p>
            </main>
        </div>
    );
}

export default App;
